export const getMove = (move:any)=>{
  return {
    id: move.id,
    name: move.name,
    power: move.power,
    pp: move.pp,
    type: move.type.name,
    accuracy: move.accuracy,
    damageClass: move.damage_class.name
  }
}

export const getStats = (stat: any) => {
  return {
    base_stat: stat.base_stat,
    name: stat.stat.name
  }
}
